import React from "react";
import "./TOS.css";

const TOS = () => {
  return (
    <div className="container">
      <h2>Terms of Service</h2>
      <p>By using this service, you agree to the following terms...</p>
      <ul>
        <li>No unauthorized access</li>
        <li>No spamming</li>
        <li>Respect user privacy</li>
      </ul>
    </div>
  );
};

export default TOS;
